using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct MovementComponentResolver : IResolver<MovementComponent>, IResolver<MovementComponentResolver,MovementComponent>, IData	{		public MovementComponentResolver In(ref MovementComponent movementcomponent)		{			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<MovementComponent>();			Out(ref local);		}		public void Out(ref MovementComponent movementcomponent)		{		}	}}